mapper.select:
SELECT

FROM pack_data_info


		and gprs_id = #{gprsId,jdbcType=VARCHAR}


		and rcv_time >= #{rcvTime1,jdbcType=TIMESTAMP}


		and rcv_time <= #{rcvTime2,jdbcType=TIMESTAMP}


		and state = #{state,jdbcType=VARCHAR}


		and gen_vol <= #{maxVol,jdbcType=DECIMAL}


		and gen_vol >= #{minVol,jdbcType=DECIMAL}


		and (
			(gen_cur >= ABS(#{minCur,jdbcType=DECIMAL}) AND gen_cur <= ABS(#{maxCur,jdbcType=DECIMAL}))
			OR
			(gen_cur >= #{maxCur,jdbcType=DECIMAL} AND gen_cur <= #{minCur,jdbcType=DECIMAL})
		)

SELECT

FROM pack_data_info WHERE gprs_id = #{gprsId,jdbcType=VARCHAR} and id < #{id,jdbcType=INTEGER}
	ORDER BY id DESC LIMIT #{pageNum,jdbcType=INTEGER}, #{pageSize,jdbcType=INTEGER}

SELECT

FROM pack_data_info a WHERE gprs_id = #{gprsId,jdbcType=VARCHAR} and id > #{id,jdbcType=INTEGER}
	ORDER BY id ASC LIMIT #{pageNum,jdbcType=INTEGER}, #{pageSize,jdbcType=INTEGER}

SELECT

FROM pack_data_info


			and gprs_id = #{gprsId,jdbcType=VARCHAR}


			and rcv_time >= #{startTime,jdbcType=TIMESTAMP}


			and rcv_time <= #{endTime,jdbcType=TIMESTAMP}


			and state = #{state,jdbcType=VARCHAR}


	ORDER BY id DESC
	LIMIT #{pageNum,jdbcType=INTEGER}, #{pageSize,jdbcType=INTEGER}

select

from pack_data_info


		and gprs_id = #{gprsId,jdbcType=VARCHAR}


		and rcv_time < #{rcvTime,jdbcType=TIMESTAMP}


		and state = #{state,jdbcType=VARCHAR}


order by rcv_time desc
limit 0,2

select

from pack_data_info


		and gprs_id = #{gprsId,jdbcType=VARCHAR}


		and state = #{state,jdbcType=VARCHAR}



		and rcv_time >= #{startTime,jdbcType=TIMESTAMP}


		and rcv_time <= #{endTime,jdbcType=TIMESTAMP}


order by rcv_time desc
